import styled from "styled-components";

export const ButtonStyle = styled("button")`
  position: absolute;
  display: flex;
  align-items: center;
  width: 324px;
  height: 49px;
  right: 25px;
  background: rgba(250, 84, 243, 0.23);
  border: 1px solid #f4f4f4;
  border-radius: 16px;
`;
